import React, { Component } from 'react';

import CartItem from './CartItem/CartItem';

class Cart extends Component {
    render () {
        return (
            <div>
                {this.props.itemsInCart(product => (
                    <CartItem
                        key={product.id}
                        product={product}
                        onClick={this.props.onClick}/>
                ))}
            </div>
        );
    }
}

export default Cart
